# Importar las librerías necesarias
import numpy as np
from tensorflow.keras.models import Sequential
from tensorflow.keras.layers import Dense

# Datos de entrada para la compuerta AND
# X contiene todas las combinaciones de entrada posibles (0,0), (0,1), (1,0), (1,1)
X = np.array([[0,0], [0,1], [1,0], [1,1]])

# Salidas esperadas para la compuerta AND
# Solo es 1 cuando ambas entradas son 1
y = np.array([[0], [0], [0], [1]])

# Crear el modelo del perceptrón multicapa
model = Sequential()

# Capa oculta con 2 neuronas y función de activación 'relu'
model.add(Dense(2, input_dim=2, activation='relu'))

# Capa de salida con 1 neurona y función de activación 'sigmoid'
model.add(Dense(1, activation='sigmoid'))

# Compilar el modelo
model.compile(loss='binary_crossentropy', optimizer='adam', metrics=['accuracy'])

# Entrenar el modelo
model.fit(X, y, epochs=1000, verbose=0)

# Evaluar el modelo
loss, accuracy = model.evaluate(X, y)
print(f'Precisión del modelo: {accuracy*100:.2f}%')

# Predecir los resultados para las entradas AND
predicciones = model.predict(X)
print("Predicciones:")
for i, entrada in enumerate(X):
    print(f"Entrada: {entrada} => Predicción: {predicciones[i][0]:.4f}")

